  \"2013-03-15T21:10:22.345642\",\n\t\"name\": \"depth-to-ground-water-contours-of-hydrographic-area-153-diamond-valley-nevada\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of depth to ground
  water contours for hydrographic-area (HA) 153, Diamond Valley, Nevada. These data
  represent static ground-water levels measured in the HA during March and April of
  2001. These data were created as part of an effort to provide statewide information
  on water table and depth to ground water for Nevada. Digital water-table contours
  from 38 published reports representing data from 1947 to 2004 were combined to create
  a single statewide data set. Water-table contours for Diamond Valley were published
  in 1968 (Harrill, 1968), the depth to water has increased by tens of feet in this
  basin, however, so more recent data were needed to estimate current contours. This
  data set and the associated water-table data were used to develop raster based models
  of water table and depth to ground water. Reference Cited Harrill, J.R., 1968, Hydrologic
  response to irrigation pumping in Diamond Valley, Eureka and Elko Counties, Nevada,
  1950-65, with a section on surface water by R.D. Lamke: Nevada Department of Conservation
  and Natural Resources, Water Resources Bulletin 35, 85 p.\",\n\t\"license_title\":
